When using this pattern we have to be careful with the order of functions in the pipeline. It is easy to make a mistake when the end type has many attribute of the same type. type alias User = { name: String , email: String } With this type, we can mix up the order of name validation and email validation e.g. Ok User |> validateEmail user.email |> validateName user.name This will work, but it will give us a User with the attributes mixed up: { name = "sam@sample.com"
, email = "Sam"
} Some example packages using this: Json decoding https://package.elm-lang.org/packages/elm/json/latest/Json.Decode Validation https://package.elm-lang.org/packages/stoeffel/elm-verify/latest/ More validation https://package.elm-lang.org/packages/gege251/elm-validator-pipeline/
